如果函数没有参数，在 C++ 中不建议写 void, 因为那样太难看了，写也没错 // C++
void Func()
{ ;
} 而在 C 中则必须写 // C
void Func(void)
{ ;
} 在 C 语言中如果写成这样 void Func() 等同于 void Func(...), 表示形参个数和类型不确定，并非没有参数， 这会暂时挂起编译器的类型检查机制，造成类型安全隐患

